using namespace std;
int testcase = 0;
double totalRunTime = 0;

int minDistance(int A[], int n){
    ++testcase;
    //Basic Op Counter
    int counter = 0;//initialised to zero
    
    /*
     find minimum and maximum values in the array
     */
    int minValue = A[0];
    int maxValue = A[0];
    for (int a = 0; a <= n-1; a++) {
        if (A[a]<minValue) {
            minValue = A[a];
        }
        if (A[a]>maxValue){
            maxValue = A[a];
        }
    }
    
    //Timer
    clock_t start;
    double duration;
    start = clock();
    
    /*Reason this was used is because the value of INFINITY in C++ is not the infinite value an integer type variable can store. */
    int dmin = numeric_limits<int>::max();
    
    for (int i = 0; i<=n-1; i++) {
        for (int j = 0; j <= n-1; j++) {
            if (A[i]>A[j]) {
                if (++counter && ((i!=j)&&((ceil(A[i]-A[j]))<dmin))){
                    dmin = ceil(A[i]-A[j]);//++counter;
                }
            }
            else if (A[j]>A[i]) {
                
                if (++counter && ((i!=j)&&((ceil(A[j]-A[i]))<dmin))){
                    dmin = ceil(A[j]-A[i]);//++counter;
                }
            }
        }
    }
    
    //OUTPUT and Timer Logic
    cout << "TEST CASE: " << testcase << "\n" << "-----------------------------\n";
    cout << "Data Input Size: " << n << "\n";
    cout << "The Minimum and Maximum values in the array are: "<< minValue << ", and " << maxValue << "\n" ;
    cout << "Basic Operations: " << counter << " \n";
    duration = (clock() - start) / (double)CLOCKS_PER_SEC;
    cout << "Time: " << duration  << "\n";
    totalRunTime += duration;
    
    if  (dmin == 2147483647){
        //this allows for an array with one element which is 0 to return 0 as the minimum distance as no two values were available to be compared
        dmin = 0;
    }
    
    if(dmin<0){
        dmin *= -1;//to return positive numbers
    }
    cout << "Min Distance: " ;
    return dmin;
}

